import React from 'react';
import { connect } from 'react-redux';
import { browserHistory } from 'react-router';

import { signUpRequest, signInRequest, signOut } from '../../actions/userAuth-actions.js';
import { userProfileFetchRequest, userProfileUpdateRequest } from '../../actions/userProfile-actions.js';

import UserAuthForm from '../userAuth-form';
import Chat from '../chat';
import UserProfileForm from '../userProfile-form';
import Modal from '../helpers/modal';
import { classToggler, userValidation, logError, renderIf } from './../../lib/util.js';

class LandingContainer extends React.Component {
  constructor(props){
    super(props);
    this.state = { profileFormDisplay: true, authFormAction: 'Register' }
  }
  // componentWillMount() {
  //   userValidation(this.props);
  // }

  handleSignin = (user, errCB) => {
    this.setState({ showLogin: false });
    return this.props.signIn(user)
      .then(() => {
        return this.props.userProfileFetch()
          .catch(err => logError(err));
      })
      .then(() => {
        return this.setState({ showDropDown: false });
      })
      .catch(err => {
        logError(err);
        errCB(err);
      });
  };
  handleSignup = (user, errCB) => {
    this.setState({ showLogin: false });
    return this.props.signUp(user)
      .then(() => {
        return this.props.userProfileFetch()
          .catch(err => logError(err));
      })
      .then(() => {
        return this.setState({ showDropDown: false });
      })
      .catch(err => {
        logError(err);
        errCB(err);
    });
  };
  handleSignOut = () => {
    this.setState({ showLogin: false });
    this.props.signOut();
    this.setState({ showDropDown: false });
    this.props.history.push('/');
  };
  handleProfileUpdate = profile => {
    return this.props.userProfileUpdate(profile)
      .catch(logError);
  };

  render() {
    let profileAction ='create';
    let handleComplete = this.state.authFormAction === 'Register' ? this.handleSignup : this.handleSignin;
    return (
      <section className='landingContainer container-outer'>
      {renderIf(!this.props.userAuth,
        <div>
          <UserAuthForm authFormAction={this.state.authFormAction} onComplete={handleComplete} />
            <div className='userauth-buttons'>
              {renderIf(this.state.authFormAction==='Register',
                <div>
                  <p className='question'>
                    Already have an account?
                  </p>
                <button className='button oauthbuttonText lightGray' onClick={() => this.setState({authFormAction: 'Sign In'})}>Sign In</button>
                </div>
              )}
              {renderIf(this.state.authFormAction==='Sign In',
                <div>
                  <p className='question'>
                    Dont't have an account yet?
                  </p>
                  <button className='button oauthbuttonText lightGray' onClick={() => this.setState({authFormAction: 'Register'})}>Registration</button>
                </div>
              )}
            </div>
        </div>
      )}
        {renderIf(this.props.userAuth,
          <div>
            {renderIf(this.state.profileFormDisplay && this.props.userProfile && this.props.userProfile.lastLogin === this.props.userProfile.createdOn,
              <div>
                <p>logged in</p>
                <Chat />
              </div>
              // <Modal heading='Create Profile' close={() => { this.setState({ profileFormDisplay: false }); this.handleProfileUpdate(this.props.userProfile); }}>
              //   <UserProfileForm userProfile={this.props.userProfile} onComplete={this.handleProductCreate} profileAction={profileAction} />
              // </Modal>
            )}
          </div>
        )}
      </section>
    );
  }
}

let mapStateToProps = state => ({
  userAuth: state.userAuth,
  userProfile: state.userProfile,
});

let mapDispatchToProps = dispatch => ({
  tokenSignIn: token => dispatch(tokenSignInRequest(token)),
  signUp: user => dispatch(signUpRequest(user)),
  signIn: user => dispatch(signInRequest(user)),
  userProfileFetch: () => dispatch(userProfileFetchRequest()),
  signOut: () => dispatch(signOut()),
  userProfileUpdate: profile => dispatch(userProfileUpdateRequest(profile)),
});

export default connect(mapStateToProps, mapDispatchToProps)(LandingContainer);
